Assignment::CurrentStatusTypeEnum Assignment::toCurrentStatusTypeEnum(const utility::string_t& value) const
{
    
    if (value == utility::conversions::to_string_t("NEW")) {
        return CurrentStatusTypeEnum::NEW;
    }
    
    if (value == utility::conversions::to_string_t("IN_PROGRESS")) {
        return CurrentStatusTypeEnum::IN_PROGRESS;
    }
    
    if (value == utility::conversions::to_string_t("SUBSCRIBED")) {
        return CurrentStatusTypeEnum::SUBSCRIBED;
    }
    
    if (value == utility::conversions::to_string_t("ARCHIVED")) {
        return CurrentStatusTypeEnum::ARCHIVED;
    }
    
    throw std::invalid_argument("Invalid value for conversion to CurrentStatusTypeEnum");
}


